シガー挿込 デジタル表示【電圧計】ボルテージメーター WF-021 
&nbsp; 



エンジンをとめた状態で音楽を聞き続けたり、電装品を使ったりするときに、バッテリー状態がこまかく把握できます。 バッテリー上がりでエンジンがかからないという自体を防げるので、シングルバッテリー車には特に有効。レッドのLED表示で見やすく表示されます。 
&nbsp;
&nbsp; 




仕様
最低電圧4V／最高電圧30V ▼サイズ▼ 全長：70mm（挿込んだ状態の突起で35mm前後） 幅：40mm 厚さ：30mm&nbsp;

ご注意
※新品ですが輸入品のため本体・箱に多少の汚れ擦り傷ある場合もございますがあらかじめご了承下さい。 



&nbsp;&nbsp; インフレームを使っています。未対応のブラウザをお使いの方はシードスタイルの売れ筋人気アイテムをクリック！
